import React from "react";
import "./Log.css";
import { useState } from "react";
export default function Log_sign() {
  const [log, changelog] = useState(true);
  const [sign, changesign] = useState(false);
  const func1 = () => {
    changelog(true);
    changesign(false);
  };
  const func2 = () => {
    changesign(true);
    changelog(false);
  };

  return (
    <div className="LogMain1">
      {log && (
        <div className="Login">
          <div className="loginsub1">
            <p className="loginhead">Log In</p>
            <div className="inputlog">
              <input className="inputlogip" type="text" placeholder="Email" />
            </div>
            <div className="inputlog">
              <input
                className="inputlogip"
                type="text"
                placeholder="Password"
              />
            </div>
            <div className="inputlogbtn">
              <button>Log In</button>
            </div>
          </div>
        </div>
      )}
      {!log && <div className="Login2"></div>}
      {sign && <div className="signup"></div>}
      {!sign && <div className="signup2"></div>}
    </div>
  );
}
